module three_input_and_gate_masked (
    input A0,
    input A1,
    input B0,
    input B1,
    input C0,
    input C1,
    input rN,
    output Y0,
    output Y1
);

wire p00, p01, p10, p11;
wire c0, c1;

assign p00 = A0 & B0;
assign p01 = A0 & B1;
assign p10 = A1 & B0;
assign p11 = A1 & B1;

assign c0 = p00 ^ p01 ^ rN;
assign c1 = p11 ^ p10 ^ rN;

assign Y0 = c0 & C0;
assign Y1 = c1 & C1;

endmodule
